package project.jun.util.cache;import java.util.List;import project.jun.dao.result.HoList;import project.jun.dao.result.HoMap;public interface HoCache {	/**	 * key목록 조회.	 * @return	 */	public List keyList();	/**	 * 조회.	 * @param key	 * @return	 */	public Object getElement(Object key);	/**	 * 조회.	 * @param key	 * @return	 */	public Object get(Object key);		public HoList getHoList(Object key);		public HoMap getHoMap(Object key);			/**	 * cache  insert	 * @param key	 * @param entry	 */	public void put(Object key, Object entry);		public void flush();		/**	 * cache  delete	 * @param key	 * @param entry	 */	public boolean remove(Object key);	public boolean [] removeAll();	public Object getCacheManager();}